import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var XCircle = createReactComponent("XCircle", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["line", {
  x1: "15",
  y1: "9",
  x2: "9",
  y2: "15",
  key: "jmj1s"
}], ["line", {
  x1: "9",
  y1: "9",
  x2: "15",
  y2: "15",
  key: "bhcchc"
}]]]);
export default XCircle;
